function gIniTiles() {
  wgTileMap.addTile(13, aEnemy, { tex: "sample_0/edt.png", 
                                 texinfo: {cols:2, rows:2, width:256, height:256, set:0},
                                 texani: {from:0, to:3, speed:0.2, cycle:1},
                                 group: 1, 
                                 atyp: 1
                               });
  
  wgTileMap.addTile(1, aSolid, {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:2},   //2topleft
                                    group: 0, render:1},
                                   {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:0}   //3top
                                    ,group: 0},
                                   {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:3}   //4topright
                                    ,group: 0},
                                   {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:4}   //5left
                                    ,group: 0},
                                   {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:6}   //6right
                                    ,group: 0},
                                   {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:1}   //7def
                                    ,group: 0},
                                   {tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:7}  //8def2
                                    ,group: 0}
                               );
  
  wgTileMap.addTile(2, aIce, { tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:13}
                                    ,group: 0
                               });
  
  //tree
  wgTileMap.addTile(4, aSolid, { tex: "sample_0/tree.png",
                                    size: {x:64,y:128,rand:1,min:1,max:2},
                                    group: 1
                               });
  
  wgTileMap.addTile(5, aSolid, { tex: "sample_0/worldatlas.png",
                                    texinfo: {cols:4, rows:4, width:256, height:256, set:9},
                                    group: 1
                               });
  wgTileMap.addTile(11, aPresent, { tex: "sample_0/present.png",
                                    group: 1, size: {x: 32, y:32}
                               });
							   
  wgTileMap.addTile(12, aPlayer, { tex: "sample_0/playeratlas.png",
                                    texinfo: {cols:2, rows:5, width:256, height:640, set:2},
                                    group: 1, size: {x: 96, y:96}
                               });
}


